script: |
  super -f text -I q3552.spq | sort > q3552.out

inputs:
  - name: q3552.spq
    data: |
      SELECT DISTINCT col0 - ( col2 ) * + col0 * - 63 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 NOT IN ( + + col0 * - 21, 91, - ( + col0 ) * 20 - + + col0 / + + ( col0 ) );
  - name: tab2

outputs:
  - name: q3552.out
    data: |
      161344
      274125
      66700
